import React from "react";
const timeTable = (props) => {
  return (
    <table>
      <thead>
        <tr>
          <th>#</th>
          <th>First Name</th>
          <th>Last Name</th>
          <th>Username</th>
        </tr>
      </thead>
      <tbody>
        <tr>
          <td>1</td>
          <td>Mark</td>
          <td>Otto</td>
          <td>@mdo</td>
        </tr>
      </tbody>
      <tr>
        Monday
        {props.day.map((e) => (
          <td>{e.sub}</td>
        ))}
      </tr>
    </table>
  );
};

export default timeTable;
